tazhoo_deen: 
Рекомендации по оформлению вакансий:
 -название вакансии (кто и где);
 -описание того что нужно делать;
 -требования к кандидатам;
 -вилка зарплат (от и до);

Всем привет! В наш проект, "Бабушкин суп из данных" требуется разработчик / devops, который:

Умеет программировать на python;
Умеет linux;
Не боится машинного обучения;

“Бабушка” занимается анализом и моделированием контекстной рекламы в системе Adwords (Google). На основе “Бабушкиных” прогнозов принимаются миллионы финансовых решений каждый день. 

Компания прибыльна, имеет только добрых владельцев и иностранных клиентов. 
Если “Бабушка” посчитает, что зарплата, которую Вы заслуживаете, меньше :fork: 120-150 р., она расстроится и не возьмет Вас на работу. 

Бонусы от “Бабушки”: 
Удобный офис на Парке Культуры
Достаточно свободный график (работайте, сколько влезет!); 
Возможность частично удаленной работы; 
Работа в тесном коллективе людей с физфака МГУ 

Если вам интересно познакомиться ближе, "Бабушка" подготовила задание, <https://github.com/grannydatasoup/devops-test>, присылайте решения на <mailto:job@solutions.se|job@solutions.se>

Репост приветствуется
